import { Schema,model } from "mongoose";

const UserSchema = new Schema({
    username: {type: String, 
               required: true,
               unique: true,
            },
    email: {
        type: String,
        required: true,
        unique: true
    },        
    password: {type: String, 
               required: true
              },
    
    name: {type: String},
    lastname: {type: String},
});

export default model('User',UserSchema);

