import express from 'express';
import {findProducts}from '../controllers/findProducts';
import {SaveProducts} from '../controllers/SaveProducts';
import { QueryProducts,SendFileProducts } from '../controllers/QueryProducts';


const ProductsRoute = express.Router();

ProductsRoute.get('/products', findProducts)

//router.get('/Products/Image',SendFileProducts)

ProductsRoute.post('/products',SaveProducts)

ProductsRoute.post('/products/search',QueryProducts)

ProductsRoute.get('/products/recommended')


module.exports = ProductsRoute;

