import productos from '../models/productos';
import path from 'path'


export const QueryProducts = async (req, res) => {
    const query = await productos.find()
    console.log(req.body.params)
    

    const newQuery = query.filter(function(item){
         const product = item.name;
         return product.indexOf(req.body.params) > -1
    })
    console.log(newQuery);
    res.json(newQuery);
    

}

export const SendFileProducts = async (req, res) => {
    let options = {
        root: path.join(__dirname,'public/img/uploads'),
        dotfiles: 'deny',
      
    }
    
    
    let fileName = req.params.filename;
    res.sendFile(fileName,options,function (err){
        if(err){
            console.log(err);
        }else{
            console.log("File sent successfully");

        }
    })
}

