import {Schema,Model, model} from 'mongoose';

const schema = new Schema({
    id_productos: {type: [Schema.Types.ObjectId],ref: "productos"},
    
    cantidadDeVistos: [Number],
    
    id_user: {type: Schema.Types.ObjectId, ref: "User"}
})

export default model("top10", schema);

