import purchasedProducts from "../models/purchasedProducts";
import User from "../models/users";

export const comprasDeUsuario = (req,res) => {
    const authorization = req.get('authorization');
    
    let token = '';

    if(authorization && authorization.toLowerCase().startsWith('bearer')){
       token = authorization.split('') 
    }
    let decodeToken = {};
    
    decodeToken = jwt.verify(token,'cfiifcas7mert')

    if(!token || !decodeToken.id){
        return res.status(401).json({error: 'unauthorized'})
    }

    const user = User.findById(req.body._id)

    if(user){
        const productos = purchasedProducts.find({user_id: user._id})
    
        res.json(productos)
    }

    
}

